export function Kapcsolat(uzenet) {
    var user = JSON.parse(localStorage.getItem("user"))
    fetch("https://discord.com/api/webhooks/1357612396352376975/ZQLpVYWwkOnc6ns0_S2jDF-GH7d0tf0vfYWF-y0RDEMkpMKK04AygQZQKQYMBc5NekEM", {
        method: "POST",
        headers: {
            "Content-Type": "application/json"
        },
        body:
            JSON.stringify({
                content: `
                ## **${"`"}Felhasznalonev${"`"}** \n - ${user.Felhasznalonev} 
                \n## **${"`"}TeljesNev${"`"}** \n - ${user.TeljesNev} 
                \n## **${"`"}Email${"`"}** \n - ${user.Email} 
                \n## **${"`"}Uzenet${"`"}** \n - ${uzenet} `
            })
    })
}
